import React from "react";
import "./App.css";
import { PowerBIEmbed } from 'powerbi-client-react';
import { models } from 'powerbi-client';

function Header(props) {
  return (
    <header>
      <h1>{props.name}'s Kitchen</h1>
    </header>
  );
}

function Main() {
  return (
    <main>
      <PowerBIEmbed
	    embedConfig = {{
		  type: 'report',   // Supported types: report, dashboard, tile, visual and qna
		  id: '4d696ece-5cb7-4250-9be4-ce160931b242',
		  embedUrl: "https://app.powerbi.com/reportEmbed?reportId=4d696ece-5cb7-4250-9be4-ce160931b242&groupId=e86aa8ce-18f2-4fba-bb98-4bb45fdab66e&w=2&config=eyJjbHVzdGVyVXJsIjoiaHR0cHM6Ly9XQUJJLVVTLU5PUlRILUNFTlRSQUwtRi1QUklNQVJZLXJlZGlyZWN0LmFuYWx5c2lzLndpbmRvd3MubmV0IiwiZW1iZWRGZWF0dXJlcyI6eyJtb2Rlcm5FbWJlZCI6dHJ1ZSwiY2VydGlmaWVkVGVsZW1ldHJ5RW1iZWQiOnRydWUsInVzYWdlTWV0cmljc1ZOZXh0Ijp0cnVlfX0%3d",
		  accessToken: 'eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiIsIng1dCI6Im5PbzNaRHJPRFhFSzFqS1doWHNsSFJfS1hFZyIsImtpZCI6Im5PbzNaRHJPRFhFSzFqS1doWHNsSFJfS1hFZyJ9..bSUwQ7X5x5jor0iD7gSlCHcwmG4W50GG1gm0J7p4Mvv4PVtO90VrYMtBUci6o0VGoQwake9kNmfSOXbPapIyiZoIorLwn0B2bZX22tyQoAZ2PKYJTehEgOIH2v0rl76m2iO3OZZQZLHwF_kfjganBJNLBx2rxYsfGAs-qEJ6biASKfEMDWe7fHrwlEsiHrKo7QANuw6gkIHu5WDRT_okOT1PF_sbto7-4Yp7zPC7RoI0YRbp0Au8WarSXdqFUjMJxFReb2omfQIAMXC90zZuxn3Y40OkgeG-Diy07iy5N_wKvOATib8Lcd0dKI0T9nxJrE7WFKMfPuHfg_uJ5oCa3Q',
		  tokenType: models.TokenType.Aad,
		  settings: {
			  panes: {
				  filters: {
					  expanded: false,
					  visible: true
				  }
			  },
			  background: models.BackgroundType.Transparent,
		  }
	  }
  }

	eventHandlers = { 
		new Map([
			['loaded', function () {console.log('Report loaded');}],
			['rendered', function () {console.log('Report rendered');}],
			['error', function (event) {console.log(event.detail);}]
		])
	}

	cssClassName = { "powerBIContainer" }

	getEmbeddedComponent = { (embeddedReport) => {
		window.report = embeddedReport;
	}}
/>

    </main>
  );
}

function Footer() {
  return (
    <footer>

    </footer>
  );
}



function App() {
  return (
    <div className="App">
      <Header/>
      <Main/>
      <Footer/>
    </div>
  );
}

export default App;
